"use strict";(self.webpackChunkblog=self.webpackChunkblog||[]).push([[1477],{10:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"20230105","metadata":{"permalink":"/blog/20230105","editUrl":"https://github.com/djunnni/djunnni.github.io/tree/main/blog/daily/20230105.md","source":"@site/blog/daily/20230105.md","title":"2023\ub144 1\uc6d4 5\uc77c \uc77c\uc9c0","description":"\ub2e4\uc74c\uc8fc\ubd80\ud130 \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uc778\ub370 \uc61b\ub0a0\uc5d0 \uc9c0\uc560\ub2d8\uc774 \uc8fc\uc2e0 \ud3ec\uc2a4\ud2b8\uc787\uc774 \uc0dd\uac01\ub098\uc11c \uc801\uc5b4\ubd24\uc5b4\uc694.","date":"2023-01-15T09:23:24.000Z","formattedDate":"January 15, 2023","tags":[{"label":"daily","permalink":"/blog/tags/daily"}],"readingTime":0.645,"hasTruncateMarker":false,"authors":[{"name":"Dongjoon Lee","title":"FullStack Engineer","url":"https://github.com/djunnni","imageURL":"https://github.com/djunnni.png","key":"djunnni"}],"frontMatter":{"slug":"20230105","title":"2023\ub144 1\uc6d4 5\uc77c \uc77c\uc9c0","authors":["djunnni"],"tags":["daily"]},"nextItem":{"title":"2023\ub144 1\uc6d4 14\uc77c \uc77c\uc9c0","permalink":"/blog/20230114"}},"content":"\ub2e4\uc74c\uc8fc\ubd80\ud130 \ud504\ub85c\uc81d\ud2b8 \uc2dc\uc791\uc778\ub370 \uc61b\ub0a0\uc5d0 \uc9c0\uc560\ub2d8\uc774 \uc8fc\uc2e0 \ud3ec\uc2a4\ud2b8\uc787\uc774 \uc0dd\uac01\ub098\uc11c \uc801\uc5b4\ubd24\uc5b4\uc694.\\r\\n\\r\\n\ud504\ub85c\ub355\ud2b8 \ub9ac\ub354\uac00 \uc870\uc9c1\uc758 \ud504\ub85c\ub355\ud2b8 \ubc29\ud5a5\uc744 \uc774\ub044\ub294 \uac74 \ub9de\uc9c0\ub9cc\\r\\n\\r\\n\ub298 \uace0\ubbfc\ud574\uc57c \ud558\ub294 \uac74\\r\\n\\r\\n\\"\uc0ac\uc6a9\uc790\uc5d0\uac8c \ud569\ub9ac\uc801\uc778 \uac00\uce58\ub97c \uc804\ud558\ub294\uac00?\\"\\r\\n\\r\\n\\"\uc0ac\uc6a9\uc790\uc758 \uc774\uc6a9\uc744 \uc720\uc9c0(Retiention)\ud558\uae30\uc5d0 \ucda9\ubd84\ud55c\uac00?\\"\\r\\n\\r\\n\\"\uacbd\ud5d8\uc774 \ucda9\ubd84\ud788 \ub9e4\ub044\ub7ec\uc6b4\uac00?\\"\\r\\n\\r\\n\ud558\ub294 \ubd80\ubd84\uc774\ub2e4. \uc81c\ud488\uc5d0\uc11c\ub3c4, \ube0c\ub79c\ub529\uc5d0\uc11c\ub3c4."},{"id":"20230114","metadata":{"permalink":"/blog/20230114","editUrl":"https://github.com/djunnni/djunnni.github.io/tree/main/blog/daily/20230114.md","source":"@site/blog/daily/20230114.md","title":"2023\ub144 1\uc6d4 14\uc77c \uc77c\uc9c0","description":"[\ub7ec\uc140\uc758 \uba85\uc81c\uc640 \ub17c\ub9ac]\ub77c\ub294 \ucc45\uc744 \uc811\ud588\ub294\ub370 \ucc45\uc5d0\uc11c \uc815\ub9ac\ud574\ubcfc\ub9cc\ud55c \uc694\uc18c\ub4e4\uc774 \uc788\uc5b4\uc11c \uc801\uc5b4\ubd10\uc57c\uaca0\ub2e4.","date":"2023-01-15T09:23:24.000Z","formattedDate":"January 15, 2023","tags":[{"label":"daily","permalink":"/blog/tags/daily"},{"label":"book","permalink":"/blog/tags/book"}],"readingTime":1.755,"hasTruncateMarker":false,"authors":[{"name":"Dongjoon Lee","title":"FullStack Engineer","url":"https://github.com/djunnni","imageURL":"https://github.com/djunnni.png","key":"djunnni"}],"frontMatter":{"slug":"20230114","title":"2023\ub144 1\uc6d4 14\uc77c \uc77c\uc9c0","authors":["djunnni"],"tags":["daily","book"]},"prevItem":{"title":"2023\ub144 1\uc6d4 5\uc77c \uc77c\uc9c0","permalink":"/blog/20230105"},"nextItem":{"title":"2022\ub144 \ud68c\uace0","permalink":"/blog/review/2022"}},"content":"[\ub7ec\uc140\uc758 \uba85\uc81c\uc640 \ub17c\ub9ac]\ub77c\ub294 \ucc45\uc744 \uc811\ud588\ub294\ub370 \ucc45\uc5d0\uc11c \uc815\ub9ac\ud574\ubcfc\ub9cc\ud55c \uc694\uc18c\ub4e4\uc774 \uc788\uc5b4\uc11c \uc801\uc5b4\ubd10\uc57c\uaca0\ub2e4.\\n\\n1. \uba85\uc81c - \ucc38\uacfc \uac70\uc9d3\uc744 \uba85\ud655\ud788 \ud310\ubcc4\ud560 \uc218 \uc788\ub294 \ubb38\uc7a5\uc774\ub098 \uc2dd\\n2. \uba85\uc81c\ub294 \uac00\uc815\uacfc \uacb0\ub860\uc73c\ub85c \uad6c\uc131\ub41c\ub2e4.\\n    * p(\uac00\uc815)\uc774\uba74 q(\uacb0\ub860)\uc774\ub2e4.\\n3. \uc5ed / \uc774 / \ub300\uc6b0\uc758 \uad00\uacc4\\n    * \ubb38\uc7a5 : p\uc774\uba74 q\ub2e4.\\n    * \uc5ed: q\uc774\uba74 p\ub2e4.\\n    * \uc774: ~p\uc774\uba74 ~q\ub2e4.\\n    * \ub300\uc6b0: ~q\uc774\uba74 ~p\ub2e4.\\n4. \ucda9\ubd84\uc870\uac74\uacfc \ud544\uc694\uc870\uac74\\n    * p\uc774\uba74 q\uc774\ub2e4.\\n        * p\ub294 \ucda9\ubd84\uc870\uac74, q\ub294 \ud544\uc694\uc870\uac74\uc758 \uad00\uacc4\ub2e4.\\n        * ex) \uc815\uc0ac\uac01\ud615\uc774\uba74 \uc9c1\uc0ac\uac01\ud615\uc774\ub2e4.\\n5. \ucd94\ub860\uacfc \uc99d\uba85\\n    * \uadc0\ub0a9 - \ud2b9\uc218\ud55c \uc0ac\uc2e4\uc774\ub098 \uc6d0\ub9ac\ub97c \ud1b5\ud574 \ubcf4\ud3b8\uc801\uc778 \uc6d0\ub9ac\ub098 \ubc95\uce59\uc744 \uc720\ub3c4\\n    * \uc5f0\uc5ed - \ubcf4\ud3b8\uc801\uc778 \uc6d0\ub9ac\ub098 \ubc95\uce59\uc5d0\uc11c \ud2b9\uc218\ud55c \uc6d0\ub9ac\ub098 \uc0ac\uc2e4\uc744 \uc720\ub3c4\\n6. \uadc0\ub958\ubc95\uacfc \uc218\ud559\uc801 \uadc0\ub0a9\ubc95\\n    * \uc9c1\uc811 \uc99d\uba85\\n        * \uc218\uc2dd\uc73c\ub85c \uc99d\uba85\ud558\ub294 \ubc29\ubc95\\n        * a^2 - b^2 = (a + b)(a - b)\\n    * \uac04\uc811 \uc99d\uba85\\n        * \uc218\ud559\uc801 \uadc0\ub0a9\ubc95\\n            * \uadc0\ub0a9\uc801 \ucd94\ub860 \ubc29\ubc95\uc774 \uc544\ub2cc **\uc5f0\uc5ed\uc801 \ucd94\ub860 \ubc29\ubc95**\uc744 \ud65c\uc6a9\ud55c\ub2e4.\\n            * \ucd08\uae30 \uc0c1\ud0dc\ub85c n = k\uc77c\ub54c\ub85c \uc99d\uba85 n = k + 1 \ub54c\uc5d0\ub3c4 \uc131\ub9bd\ud568\uc744 \ubcf4\uc784.\\n        * \uadc0\ub958\ubc95\\n            *  \uba85\uc81c\uc758 \uacb0\ub860\uc744 \ubd80\uc815\ud574 \ubaa8\uc21c\uc774 \ubc1c\uc0dd\ud558\ub294 \uc9c0 \ubcf4\uc5ec\uc90c\uc73c\ub85c\uc368 \uba85\uc81c\uac00 \ucc38\uc784\uc744 \uc99d\uba85\ud55c\ub2e4."},{"id":"review/2022","metadata":{"permalink":"/blog/review/2022","editUrl":"https://github.com/djunnni/djunnni.github.io/tree/main/blog/review/2022/readme.md","source":"@site/blog/review/2022/readme.md","title":"2022\ub144 \ud68c\uace0","description":"2022\ub144\uc5d4 \uc815\ub9d0 \ub9ce\uc740 \uc77c\uc774 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.","date":"2023-01-03T00:00:00.000Z","formattedDate":"January 3, 2023","tags":[{"label":"\ud68c\uace0","permalink":"/blog/tags/\ud68c\uace0"},{"label":"2022","permalink":"/blog/tags/2022"}],"readingTime":7.595,"hasTruncateMarker":false,"authors":[{"name":"Dongjoon Lee","title":"FullStack Engineer","url":"https://github.com/djunnni","imageURL":"https://github.com/djunnni.png","key":"djunnni"}],"frontMatter":{"slug":"review/2022","title":"2022\ub144 \ud68c\uace0","authors":["djunnni"],"tags":["\ud68c\uace0","2022"],"date":"2023-01-03T00:00"},"prevItem":{"title":"2023\ub144 1\uc6d4 14\uc77c \uc77c\uc9c0","permalink":"/blog/20230114"},"nextItem":{"title":"Welcome","permalink":"/blog/welcome"}},"content":"2022\ub144\uc5d4 \uc815\ub9d0 \ub9ce\uc740 \uc77c\uc774 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n### \uad6c\ub984\uc744 \ub5a0\ub098\uba74\uc11c \\n\\n2021\ub144 12\uc6d4 \uc120\uc784 \uac1c\ubc1c\uc790\ubd84\uc774 \ud1f4\uc0ac\ud558\uc2dc\uba74\uc11c \uc800\uc5d0\uac8c \ud300\uc744 \uc774\ub04c \uc218 \uc788\ub294 \uad8c\ud55c\uc774 \uc8fc\uc5b4\uc84c\ub294\ub370\uc694.\\n\\n\uc2a4\uc2a4\ub85c \uc5f4\uc2ec\ud788 \ud574\ubcf4\uace0 \uc2f6\uc5b4\uc11c \uadfc\ubb34\uc2dc\uac04\uc5d0\ub294 \uac1c\ubc1c\uc5c5\ubb34\uc640 \uad00\ub9ac\uc5c5\ubb34\ub97c \ud1f4\uadfc\ud558\uace0 \ub098\uc11c\ub294 PM\uac15\uc758\ub3c4 \uad6c\ub9e4\ud574\uc11c \ub4e4\uc5b4\ubcf4\uace0 \ube61\ube61\ud558\uac8c \uc9c0\ub0b4\uc654\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n\ubc14\uc774\ub7f4 \ub9c8\ucf00\ud305\uc774 \uc5b4\ub5bb\uac8c \uc9c4\ud589\ub418\ub294 \uc9c0, VOC\ub294 \uc5b4\ub5bb\uac8c \ucc98\ub9ac\ub418\uc5b4\uc57c \ud560 \uc9c0, \uace0\uac1d\ub4e4\uacfc \uc5b4\ub5bb\uac8c \ud504\ub85c\uc81d\ud2b8\ub97c \uc774\ub04c\uc5b4\uc57c\ud560 \uc9c0, \uc2a4\ud504\ub9b0\ud2b8\ub294 \uc5b4\ub5bb\uac8c \uc124\uacc4\ud574\uc57c\ud558\ub294 \uc9c0, \ud300\uc6d0\uc758 \uace0\ucda9\uc774 \ubb34\uc5c7\uc774\uace0 \uc774\ub97c \uc704\ud574 \uc5b4\ub5bb\uac8c \ub3c4\uc640\uc8fc\uba74 \uc88b\uc744 \uc9c0... \ub4f1 \ub2e4\ubc29\uba74\uc73c\ub85c \uace0\ub824\ud558\uace0 \uc0dd\uac01\ud574\uc57c \ud560 \uac83\ub4e4\uc774 \uc0b0\ub354\ubbf8\uc600\uc2b5\ub2c8\ub2e4.\\n\\n\ubaa8\ub450\uc5d0\uac8c \uc774\uc775\uc774 \ub418\ub294 \ubc29\ud5a5\uc73c\ub85c \uac00\uae30 \uc704\ud574\uc11c \uacb0\uc815\uc744 \ub0b4\ub9ac\uace0 \ud53c\ub4dc\ubc31\uc744 \ubc1b\uc544\uc57c \ud558\ub294 \uc704\uce58\uc5d0\uc11c \uc2a4\uc2a4\ub85c\uc5d0\uac8c \ubd80\ub2f4\uac10\uc774 \ucef8\uc2b5\ub2c8\ub2e4.\\n\\n\uc2dc\uac04\uc774 \uc810\uc810 \uc9c0\ub098\uba74\uc11c **\uc9c4\uc9dc \ub0b4\uac00 \uc798 \ud558\ub294\uac8c \ubb34\uc5c7\uc77c\uae4c?, \uc9c0\uae08\uc758 \ub098\ub294 \uc815\uccb4\ub418\uc5b4\uc788\uc9c4 \uc54a\ub098?** \uc2a4\uc2a4\ub85c\uc5d0\uac8c \uc758\ubb38\uc774 \ub4e4\uc5c8\uace0 \uc544\uc9c1\uc740 \uac1c\ubc1c\uc790\ub85c\uc11c \ub354 \ub9ce\uc740 \uac83\ub4e4\uc744 \uacbd\ud5d8\ud558\uace0 \ubc30\uc6b8 \uc2dc\uae30\ub77c\uace0 \uc0dd\uac01\ud574 \ud1f4\uc0ac\ub97c \uacb0\uc2ec\ud588\uc2b5\ub2c8\ub2e4.\\n\\n\ubb34\uc5c7\uc778\uac00 \ubc14\ub85c \ud68c\uc0ac\uc5d0 \ub4e4\uc5b4\uac00\uae30\ubcf4\ub2e4 \ubd80\uc871\ud55c \ubd80\ubd84\uc744 \ub9e4\uafc0 \uc2dc\uac04\uc774 \ud544\uc694\ud588\uace0 \ub300\uae30\uc5c5\uc73c\ub85c \ucde8\uc9c1\ud574\ubcf4\uace0 \uc2f6\uc5b4\uc11c 1\ub144\uc774\ub77c\ub294 \uc2dc\uac04\uc744 \ud22c\uc790\ud574\ubcf4\uae30\ub85c \ud55c \uac83\uc774\uc8e0.\\n\\n### SSAFY\ub85c \ub4e4\uc5b4\uc624\uba74\uc11c\\n\\n6\uc6d4\uc5d0 \uc0bc\uc131 SW \uc544\uce74\ub370\ubbf8 8\uae30 \uacf5\uace0\uac00 \uc62c\ub77c\uc654\uace0 \uc9c0\uc6d0\uc744 \ud1b5\ud574 \ucf54\ub529\ud14c\uc2a4\ud2b8, \uba74\uc811\uc744 \uac70\uccd0 \uc785\uacfc\ud558\uac8c \ub410\uc2b5\ub2c8\ub2e4.\\n\\n\ucde8\uc5c5\uc744 \ubaa9\ud45c\ub85c\ud558\ub294 \ub3d9\uae30\ub4e4\uc774\ub791 \ud568\uaed8 \ubc30\uc6b0\uba74\uc11c \ucf54\ub529\ud14c\uc2a4\ud2b8, \uad50\uc721 \ud50c\ub7ab\ud3fc\uc744 \uc0ac\uc6a9\ud574\ubcf4\ub2c8 \uad6c\ub984\uc5d0 \uc788\uc5c8\uc744 \ub54c, \uacf5\uac10\ud558\uc9c0 \ubabb\ud588\ub358 \ubd80\ubd84\ub4e4\uc774 \ud558\ub098\uc529 \ubcf4\uc774\ub354\uad70\uc694.(\ucd9c\uc11d \uccb4\ud06c, \ucf54\ub529\ud14c\uc2a4\ud2b8\uc5d0\uc11c \ud544\uc694\ud55c \ub2c8\uc988\uac00 \ubb34\uc5c7\uc778\uc9c0 \ub4f1) \uc7ac\ubbf8\uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc5ed\uc2dc \uace0\uac1d\uc758 \uc785\uc7a5\uc5d0\uc11c \ubcf4\ub294 \uc81c\ud488\uacfc \uc815\ub9ac\ub41c VOC \ub370\uc774\ud130\ub85c \ubcf4\ub294 \uac83\uacfc\ub294 \ucc28\uc774\uac00 \ud06c\ub354\ub77c\uad6c\uc694.\\n\\n2023\ub144\uc5d4 \uc2f8\ud53c\uc5d0\uc11c \uc9c4\ud589\ud560 \ud504\ub85c\uc81d\ud2b8\uc5d0\uc11c \uae30\ud68c\uac00 \ub41c\ub2e4\uba74 \ub2e4\ub904\ubcf4\uace0 \uc2f6\uc5b4\uc9c0\ub124\uc694.\\n\\n### \ub300\ud559\uc0dd \ub54c, \ud588\ub358 \ud504\ub85c\uc81d\ud2b8 \uc815\ub9ac \uae00\ub4e4\uc744 \ubcf4\uba74\uc11c\\n\\n\uc815\ub9ac\ud558\ub294 \uc2b5\uad00\ub3c4 \uc911\uc694\ud558\ub2e4\ub294 \uac78 \uc54c\uac8c \ub410\uc2b5\ub2c8\ub2e4.\\n\\n\uc6b0\uc5f0\ud788 \ub300\ud559\uc0dd \ub54c \uae30\ub85d\ud588\ub358 [springboot 2.0](https://djunnni.gitbook.io/springboot/)\uc758 \uc778\uc0ac\uc774\ud2b8 \ud1b5\uacc4\ub97c \ubcf4\uac8c\ub410\ub294\ub370\uc694. \uc9c0\uae08\uae4c\uc9c0 \uafb8\uc900\ud788 \ubcf4\uc2dc\ub294 \ubd84\ub4e4\uc774 \ub9ce\ub2e4\ub294 \uc0ac\uc2e4\uc744 \uc54c\uc558\uc2b5\ub2c8\ub2e4.\\n\\n![spring-gitbook-insight](./img/spring-gitbook-insight.png)\\n\\n\uc774 \uc815\ubcf4\ub9cc\uc73c\ub85c\ub294 \ub0b4 \uae00\uc774 \uacfc\uc5f0 \uc88b\uc740 \uae00\uc778\uc9c0 \ud310\ubcc4\uc744 \ubabb\ud558\uaca0\ub354\ub77c\uad6c\uc694. \ub2e8\uc21c\ud788 count\ub9cc \ub192\uc544\uc84c\ub2e4\uace0 \uc0dd\uac01\ud574 GA\ub97c \uc5f0\uacb0\ud558\uace0 2\ub2ec\uc815\ub3c4\ub97c \uc9c0\ucf1c\ubd24\uc2b5\ub2c8\ub2e4.\\n\\n\ud3c9\uade0 40\ucd08 \ub3d9\uc548 \uba38\ubb3c\ub7ec \uc788\ub2e4\ub294 \uac78 \ud655\uc778\ud558\uace0 \ub09c \ub4a4, \uc880 \ucabd\ud314\ub9ac\uae30\ub3c4 \ud558\ub354\ub77c\uad6c\uc694. \ub0b4\uc6a9\uc744 \uc815\ube44\ud558\uace0 \ucc98\uc74c\ubd80\ud130 \uc62c\ubc14\ub974\uac8c \uae30\ub85d\ud558\uace0 \uc0dd\uac01\ud55c \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud574\uc57c \uaca0\uc2b5\ub2c8\ub2e4.\\n\\n### hacktoberfest 2022\uc5d0 \ucc38\uc5ec\ud558\uba70\\n\\n\uc800\uc5d0\uac8c \uc7ac\ub300\ub85c \ub41c \uccab \uc624\ud508\uc18c\uc2a4 \uae30\uc5ec \ud589\uc0ac\uc600\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uadf8\uc804\uae4c\uc9c4 \uac04\ub2e8\ud55c \ub0b4\uc6a9 \uace0\uce58\uae30\uac00 \uc8fc\uc600\ub294\ub370\uc694.\\n\\n1) nodejs.dev\uc5d0 SearchBar \uac1c\uc120 <br/>\\n2) mdx-js\uc5d0 readme docs \uc218\uc815 <br/>\\n3) hacktoberfest \uc624\ud508\uc18c\uc2a4 \ubaa9\ub85d \ucd94\uac00\\n\\n\ud589\uc0ac \uae30\uac04\uc911\uc5d0 \uba54\uc778\ud14c\uc774\ub108\ub85c\uc11c \uc774\ubc88 \ud589\uc0ac\uc5d0 \ub300\ud574 \uac00\uc9c0\uace0 \uc788\ub294 [\uc0dd\uac01](https://github.com/mdx-js/mdx/pull/2159#issuecomment-1293281030)\ub3c4 \ub4e4\uc5b4\ubcfc \uc218 \uc788\uc5c8\uace0 \ub9cc\uc57d \ub0b4\uac00 \uba54\uc778\ud14c\uc774\ub108\uac00 \ub41c\ub2e4\uba74 \uc5b4\ub5bb\uac8c \ud560 \uc9c0 \uc0dd\uac01\ud574\ubcfc \uae30\ud68c\uac00 \ub410\uc5c8\ub124\uc694. \uc5ec\ub7ec\ubd84\ub3c4 \uae30\ud68c\uac00 \ub418\uba74 \ubcf4\uc2dc\uba74 \uc88b\uaca0\uc2b5\ub2c8\ub2e4.\\n\\n\\n[![An image of @djunnni\'s Holopin badges, which is a link to view their full Holopin profile](https://holopin.me/djunnni)](https://holopin.io/@djunnni)\\n\\nholopin\uc744 \ud1b5\ud574\uc11c \ucc38\uc5ec \uc774\ub825\uc744 \ubc43\uc9c0\ub85c \ub098\ub220\uc8fc\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \ubd80\ubd84\uc774 \uc2e0\uc120\ud588\ub294\ub370\uc694. \uae43\ud5d9\uc5d0 \ub0a8\ub294 \uc774\ub825\uc678\uc5d0 \ub9cc\ub4e4\uc5b4\uc900 \uc544\uc774\ucf58\uc774 \uc7ac\ubbf8\ub97c \uc790\uadf9\ud558\ub354\ub77c\uad6c\uc694.\\n\\n\ud2f0\uc154\uce20\ub97c \ubc1b\uace0 \uc2f6\uae34 \ud588\ub294\ub370 \uc774\ubbf8 \ub0a8\uc740 \uc5ec\ubd84\uc774 \uc5c6\uc5b4\uc11c \ub098\ubb34 \ud55c \uadf8\ub8e8\ub97c \uc120\ud0dd\ud588\uace0 \ud604\uc7ac \uadf8 \ub098\ubb34\uac00 \uc778\ub3c4\uc5d0 \uc788\ub2e4\uace0 \ud558\ub124\uc694. \uaf64 \uc2e0\uc120\ud55c \uc624\ud508\uc18c\uc2a4 \ud589\uc0ac\uc600\uc2b5\ub2c8\ub2e4.\\n\uc544\ub9c8 \ub0b4\ub144\uc5d0\ub3c4 \ucc38\uac00\ud560 \uac83 \uac19\ub124\uc694.\\n\\n\ucd94\uac00\ub85c \uc678\uad6d\uc5d0 \ub300\ud559\uc0dd\uc774\ub098 \ub354 \uc5b4\ub9b0 \ub098\uc774\ub3c4 \uc790\uc720\ub86d\uac8c facebook\uc774\ub098 \uae30\ud0c0 \uc624\ud508\uc18c\uc2a4\uc5d0 \uae30\uc5ec\ud558\uace0 \uc788\ub2e4\ub294 \uc810\uc774 \ub180\ub7ac\uc2b5\ub2c8\ub2e4. \uc6b0\ub9ac\ub098\ub77c\ub3c4 \ud65c\uc131\ud654\ub418\uba74 \uc88b\uaca0\ub2e4 \uc2f6\uc5b4\uc11c \uc81c\uac00 \ucc38\uc5ec\ud574\ubcf8 \uacbd\ud5d8\uae30\uc640 \uc5b4\ub5bb\uac8c \uc2dc\uc791\ud588\ub294\uc9c0 \uc815\ub9ac\ud574\uc11c \uacf5\uc720\ud574\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\\n### \ub4f1\uc0b0\uc744 \ub2e4\ub2c8\uba74\uc11c\\n\\n\uc2a4\uc2a4\ub85c \ubc88\uc544\uc6c3\uc744 \uc774\uae30\uae30 \uc704\ud574 \ub4f1\uc0b0\uc744 \ub9ce\uc774 \ub2e4\ub154\uc2b5\ub2c8\ub2e4.\\n\\n\uccad\uacc4\uc0b0\uc744 \uc2dc\uc791\uc73c\ub85c \ubd81\ud55c\uc0b0, \ubb34\ub4f1\uc0b0, \ud55c\ub77c\uc0b0\uc744 \ub2e4\ub154\uc2b5\ub2c8\ub2e4. \uaf2d\ub300\uae30\uc5d0 \uc62c\ub77c\uac00\uba74\uc11c \ud798\ub4e0 \uc21c\uac04\ub3c4 \uc788\uc9c0\ub9cc \ud574\ub0bc \uc218 \uc788\ub2e4\ub294 \uae0d\uc815\uc801\uc778 \ub9c8\uc778\ub4dc\ub97c \ub193\uce58 \uc54a\uc558\uc8e0.\\n\\n\uc774 \uae30\ubd84\uc744 \ub2e4\uc2dc \ub290\uaef4\ubcf4\uace0 \uc2f6\uc5c8\ub358 \uac83 \uac19\uc2b5\ub2c8\ub2e4.\\n\\n### \uc790\uaca9\uc99d\uc744 \ucde8\ub4dd\ud558\uba74\uc11c\\n\\n\uc800\ub294 Opic IM\uacfc SQLD\ub97c \ucde8\ub4dd\ud588\ub294\ub370\uc694. \uc790\uaca9\uc99d\uc774 \uc804\ubd80\ub77c\ub294 \uc758\ubbf8\ub294 \uc544\ub2c8\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \ub300\uc2e0 \uc870\uae08\uc740 \uc54c\uace0 \uc788\uad6c\ub098\ub85c \ubcf4\uc774\ub294 \uc6a9\ub3c4\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n\uc5c6\ub294 \ucc44\ub85c \uc774\uc57c\uae30 \ud558\uae30\ubcf4\ub2e4\ub294 \ubb34\uc5c7\uc774\ub77c\ub3c4 +a \uc778 \uc0c1\ud0dc\uc5d0\uc11c \ub9d0\ud558\ub294\uac8c \ub354 \uc2e0\ube59\uc131\uc774 \uc788\uc5b4\ubcf4\uc774\uae30 \ub54c\ubb38\uc774\uc8e0.\\n\\n### \uc815\ub9ac\\n\\n\uc2a4\uc2a4\ub85c \ub9ce\uc740 \uacbd\ud5d8\uc744 \ud55c 2022\ub144 \uc774\ub124\uc694. 2023\ub144\uc5d4 \ubd80\uc871\ud588\ub358 \ubd80\ubd84\uc744 \ub2e4\ub4ec\uc5b4\uc11c \ub354 \ub098\uc740 \uac1c\ubc1c\uc790\ub85c \uc131\uc7a5\ud558\uace0 \uc2f6\uc5b4\uc9c0\uace0 \ubaa9\ud45c\ub97c \uc798 \uc138\uc6cc\uc57c \uaca0\uc2b5\ub2c8\ub2e4.\\n\\n\ube14\ub85c\uadf8\ub3c4 \uc0c8\ub86d\uac8c \uc5ec\uae30\uc11c\ubd80\ud130 \ub0b4\uc6a9\uc744 \uc798 \ub2e4\ub4ec\uc5b4\ubcf4\ub824\uace0 \ud569\ub2c8\ub2e4."},{"id":"welcome","metadata":{"permalink":"/blog/welcome","editUrl":"https://github.com/djunnni/djunnni.github.io/tree/main/blog/2023-01-02-welcome/index.md","source":"@site/blog/2023-01-02-welcome/index.md","title":"Welcome","description":"\ud83d\udc4b\ud83c\udffb Hi there!","date":"2023-01-02T00:00:00.000Z","formattedDate":"January 2, 2023","tags":[{"label":"blog","permalink":"/blog/tags/blog"},{"label":"docusaurus","permalink":"/blog/tags/docusaurus"}],"readingTime":0.36,"hasTruncateMarker":false,"authors":[{"name":"Dongjoon Lee","title":"FullStack Engineer","url":"https://github.com/djunnni","imageURL":"https://github.com/djunnni.png","key":"djunnni"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["djunnni"],"tags":["blog","docusaurus"]},"prevItem":{"title":"2022\ub144 \ud68c\uace0","permalink":"/blog/review/2022"}},"content":"\ud83d\udc4b\ud83c\udffb Hi there!\\n\\n2023\ub144 1\uc6d4 2\uc77c \ube14\ub85c\uadf8\ub97c \uc0c8\ub86d\uac8c \uac1c\ud3b8\ud558\ub824\uace0 \ud569\ub2c8\ub2e4.\\n\\n\uae30\uc874\uc5d0 velog, gitbook, github \ub4f1 \ub2e4\uc591\ud55c \uacf3\uc5d0 \uc790\ub8cc\ub97c \uc800\uc7a5\ud558\ub2e4\ubcf4\ub2c8 \ud30c\ud3b8\ud654\uac00 \ub354 \uc2ec\ud574\uc9c0\ub354\ub77c\uad6c\uc694.\\n\\n\uc774\ubc88\uae30\ud68c\uc5d0 \ubcc0\ud654\ub97c \uc918\ubd10\uc57c\uaca0\uc2b5\ub2c8\ub2e4 :)"}]}')}}]);